import styled from "@emotion/styled";

export const RankingWrapper = styled.div`
  display: flex;
  flex-direction: column;
  width: 100%;
`;

export const RankingMovieCard = styled.div`
  display: flex;
  flex-wrap: wrap;
  width: 100%;
`;
